<template>
<div id="rank_container">
  <div style="display: flex;justify-content: center;align-items: center;padding: 1vh 4vw 1vh 4vw;box-sizing: border-box;width: 100%;height: 7%;background-color: white;margin-top: 3%;border-radius: 0.5rem">
    <div style="letter-spacing: 0.2rem">第{{count}}赛季</div>
  </div>
  <div style="margin-top: 20px">
    <van-cell  :title-style="{'font-size':'17px'}"  :title="useData.nickname" style="--van-cell-icon-size: 23px;" icon="data:image/png;base64,"
              :value="myselfRank()"/>
  </div>
  <div style="display: flex;justify-content: center;align-items: center;padding: 1vh 4vw 1vh 4vw;box-sizing: border-box;width: 100%;height: 7%;background-color: white;margin-top: 3%;border-radius: 0.5rem">
    <div style="letter-spacing: 0.2rem">全区前10排名</div>
  </div>
<div>
  <van-list
      style="margin-top: 10px"
  >
    <van-cell :title-style="{'font-size':'17px','margin-left':'13px',}"  v-for="(item,index) in list"
              :icon="index < 3 ? 'data:image/png;base64,' : 'data:image/png;base64,'"
              style="--van-cell-icon-size: 23px;"
              :key="item" :title="item.nickname" :value="getRank(item)" />
  </van-list>
</div>

</div>
</template>

<script setup>
import useDataStore from "../../store/index.js";
import instance from "../../api/request.js";
import {onMounted, ref} from "vue";
const useData = useDataStore()

const selfRank = ref(null)

const count = ref('')

const list = ref([]);

const myselfRank = () => {
  return selfRank.value == null ?  '未上榜' : "我的排名：" + selfRank.value
}

const ranking = () => {
  instance.get('/rank/ranking').then( res => {
    if (res.data.code == '200'){
      list.value = res.data.voList
    }
  })
}

const getRank = (item) => {
  return "排名: " + item.ranking
}

const myself = () => {
  instance.get('/rank/self').then( res => {
    if (res.data.code == '200'){
      selfRank.value  = res.data.vo.ranking
      console.log(selfRank.value)
    }
  })
}

const thisCount = () => {
  instance.get('/rank/season').then( res => {
    if (res.data.code == '200'){
      count.value  = res.data.count
    }
  })
}

onMounted( () => {
  myself()
  thisCount()
  ranking()
})

</script>

<style scoped>
#rank_container{
  width: 100%;
  height: 100%;
}
</style>